import React from 'react';

const Rank = ({ name, entries }) => {
  return (
    <div>
    <iframe width="560" height="315" src="https://www.youtube.com/embed/SYnh2wd3lCg" frameborder="0" allow="autoplay=1; encrypted-media" allowfullscreen>
    </iframe>
      <div className='white f3'>
        {`${name}, your current entry count is ...`}
      </div>
      <div className='white f1'>
      {entries}
      </div>
    </div>
  );
}

export default Rank;
